"<div>\n<i class=\"NoteType\">\n\u0417\u0430\u043c\u0435\u0442\u043a\u0430 \u043e \u0441\u043e\u0431\u044b\u0442\u0438\u0438\n</i>\n<div class=\"grampsstylednote\">\n<p>\n\u0412 \u0441\u043e\u043e\u0442\u0432\u0435\u0442\u0441\u0442\u0432\u0438\u0438 \u0441 \u0440\u0435\u0448\u0435\u043d\u0438\u0435\u043c \u0421\u043e\u0432\u0435\u0442\u0430 \u0442\u0440\u0443\u0434\u0430 \u0438 \u043e\u0431\u043e\u0440\u043e\u043d\u044b \u0421\u0421\u0421\u0420 \u043e\u0442 8 \u0438\u044e\u043b\u044f 1936 \u0433. \u0440\u0435\u0447\u043d\u043e\u0439 \u0442\u0435\u0445\u043d\u0438\u043a\u0443\u043c \u0438\u0437 \u0433. \u0411\u0430\u043b\u0430\u043a\u043e\u0432\u043e \u0421\u0430\u0440\u0430\u0442\u043e\u0432\u0441\u043a\u043e\u0439 \u043e\u0431\u043b\u0430\u0441\u0442\u0438 \u0431\u044b\u043b \u043f\u0435\u0440\u0435\u0432\u0435\u0434\u0435\u043d \u0432 \u041a\u0443\u0439\u0431\u044b\u0448\u0435\u0432 \u0438 \u0441\u0442\u0430\u043b \u043d\u0430\u0437\u044b\u0432\u0430\u0442\u044c\u0441\u044f \u201c\u041a\u0443\u0439\u0431\u044b\u0448\u0435\u0432\u0441\u043a\u0438\u0439 \u0440\u0435\u0447\u043d\u043e\u0439 \u0442\u0435\u0445\u043d\u0438\u043a\u0443\u043c\u201d.\n</p>\n</div>\n</div>",
