"<div>\n<i class=\"NoteType\">\n\u041a\u0440\u0430\u0442\u043a\u0430\u044f \u0438\u0441\u0442\u043e\u0440\u0438\u044f\n</i>\n<div class=\"grampsstylednote\">\n<p>\n30 \u0434\u0435\u043a\u0430\u0431\u0440\u044f 1922 \u0431\u044b\u043b \u043e\u0431\u0440\u0430\u0437\u043e\u0432\u0430\u043d \u0421\u0421\u0421\u0420 \u0433\u043e\u0434\u0430 \u043f\u0443\u0442\u0451\u043c \u043e\u0431\u044a\u0435\u0434\u0438\u043d\u0435\u043d\u0438\u044f \u0420\u0421\u0424\u0421\u0420, \u0423\u043a\u0440\u0430\u0438\u043d\u0441\u043a\u043e\u0439 \u0421\u0421\u0420, \u0411\u0435\u043b\u043e\u0440\u0443\u0441\u0441\u043a\u043e\u0439 \u0421\u0421\u0420 \u0438 \u0417\u0430\u043a\u0430\u0432\u043a\u0430\u0437\u0441\u043a\u043e\u0439 \u0421\u0424\u0421\u0420 \u0432 \u043e\u0434\u043d\u043e \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u043e \u0441 \u0435\u0434\u0438\u043d\u044b\u043c\u0438 \u043e\u0440\u0433\u0430\u043d\u0430\u043c\u0438 \u0432\u043b\u0430\u0441\u0442\u0438 \u0441\u043e \u0441\u0442\u043e\u043b\u0438\u0446\u0435\u0439 \u0432 \u041c\u043e\u0441\u043a\u0432\u0435, \u0441 \u0441\u043e\u0445\u0440\u0430\u043d\u0435\u043d\u0438\u0435\u043c \u0437\u0430 \u043a\u0430\u0436\u0434\u043e\u0439 \u0441\u043e\u044e\u0437\u043d\u043e\u0439 \u0440\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u043e\u0439 \u043f\u0440\u0430\u0432\u0430 \u0441\u0432\u043e\u0431\u043e\u0434\u043d\u043e\u0433\u043e \u0432\u044b\u0445\u043e\u0434\u0430 \u0438\u0437 \u0421\u043e\u044e\u0437\u0430. [<a href=\"https://ru.wikipedia.org/wiki/\u0421\u043e\u044e\u0437_\u0421\u043e\u0432\u0435\u0442\u0441\u043a\u0438\u0445_\u0421\u043e\u0446\u0438\u0430\u043b\u0438\u0441\u0442\u0438\u0447\u0435\u0441\u043a\u0438\u0445_\u0420\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\">1</a>]<br />\n26 \u0434\u0435\u043a\u0430\u0431\u0440\u044f 1991 \u0433\u043e\u0434\u0430 \u0421\u043e\u0432\u0435\u0442 \u0420\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a \u0412\u0435\u0440\u0445\u043e\u0432\u043d\u043e\u0433\u043e \u0421\u043e\u0432\u0435\u0442\u0430 \u0421\u0421\u0421\u0420 \u043f\u0440\u0438\u043d\u044f\u043b \u0434\u0435\u043a\u043b\u0430\u0440\u0430\u0446\u0438\u044e \u043e \u043f\u0440\u0435\u043a\u0440\u0430\u0449\u0435\u043d\u0438\u0438 \u0441\u0443\u0449\u0435\u0441\u0442\u0432\u043e\u0432\u0430\u043d\u0438\u044f \u0421\u0421\u0421\u0420. <a href=\"place.html?pdx=156\">\u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u0430\u044f \u0424\u0435\u0434\u0435\u0440\u0430\u0446\u0438\u044f</a> \u0431\u044b\u043b\u0430 \u043f\u0440\u0438\u0437\u043d\u0430\u043d\u0430 \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u043e\u043c-\u043f\u0440\u0430\u0432\u043e\u043f\u0440\u0435\u0435\u043c\u043d\u0438\u043a\u043e\u043c \u0421\u0421\u0421\u0420 \u0432 \u043c\u0435\u0436\u0434\u0443\u043d\u0430\u0440\u043e\u0434\u043d\u043e-\u043f\u0440\u0430\u0432\u043e\u0432\u044b\u0445 \u043e\u0442\u043d\u043e\u0448\u0435\u043d\u0438\u044f\u0445 \u0438 \u0437\u0430\u043d\u044f\u043b\u0430 \u0435\u0433\u043e \u043c\u0435\u0441\u0442\u043e \u0432 \u0421\u043e\u0432\u0435\u0442\u0435 \u0411\u0435\u0437\u043e\u043f\u0430\u0441\u043d\u043e\u0441\u0442\u0438 \u041e\u041e\u041d. [<a href=\"https://ru.wikipedia.org/wiki/\u0421\u043e\u044e\u0437_\u0421\u043e\u0432\u0435\u0442\u0441\u043a\u0438\u0445_\u0421\u043e\u0446\u0438\u0430\u043b\u0438\u0441\u0442\u0438\u0447\u0435\u0441\u043a\u0438\u0445_\u0420\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\">1</a>]\n</p>\n<p>\n\u0421\u0441\u044b\u043b\u043a\u0438:<br />\n1. https://ru.wikipedia.org/wiki/\u0421\u043e\u044e\u0437_\u0421\u043e\u0432\u0435\u0442\u0441\u043a\u0438\u0445_\u0421\u043e\u0446\u0438\u0430\u043b\u0438\u0441\u0442\u0438\u0447\u0435\u0441\u043a\u0438\u0445_\u0420\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\n</p>\n</div>\n</div>",
"<div>\n<i class=\"NoteType\">\n\u0417\u0430\u043c\u0435\u0442\u043a\u0430 \u043e \u043c\u0435\u0441\u0442\u0435\n</i>\n<div class=\"grampsstylednote\">\n<p>\n\u0412\u043e \u0432\u0440\u0435\u043c\u044f \u0412\u0435\u043b\u0438\u043a\u043e\u0439 \u041e\u0442\u0435\u0447\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0439 \u0432\u043e\u0439\u043d\u044b \u043e\u043a\u043a\u0443\u043f\u0430\u043d\u0442\u044b \u0432 1943 \u0433\u043e\u0434\u0443 \u0441\u043e\u0436\u0433\u043b\u0438 \u0434\u0435\u0440\u0435\u0432\u043d\u044e \u0438 \u0443\u0431\u0438\u043b\u0438 8 \u0436\u0438\u0442\u0435\u043b\u0435\u0439\n</p>\n</div>\n</div>",
